import React from 'react';
// nodejs library that concatenates classes
import classNames from "classnames";
//nodejs library that concatenates style
import withStyles from "@material-ui/core/styles/withStyles";

//@material-ui core components
import Typography from '@material-ui/core/Typography';
import Tab from '@material-ui/core/Tab';

import TabStyle from "assets/jss/material-kit-react/components/tabStyle.jsx";

const Tabb = ({...props}) => {
	const { classes } = props;
	const TabClasses = classNames({
		[classes.tabRoot]: true,
		[classes.tabSelected]: true
	});
  	return (
    <Typography component="div" style={{padding: "0px" ,margin: "0px"}}>
		<Tab
			disableRipple
			className={TabClasses}
			label="All Design"
		>
		</Tab>
		<Tab
			disableRipple
			className={TabClasses}
			label="Part Website"
		/>
		<Tab
			disableRipple
			className={TabClasses}
			label="Full Website"
		/>
    </Typography>
  	);
};

export default withStyles(TabStyle)(Tabb);
